con:config.script:
import groovy.json.JsonBuilder  
import groovy.json.JsonSlurper  
import groovy.transform.ToString

class TrackShipmentInPuts
{
	String User_Id;
	String Pass_Word;
	String PIC_NUMBER;
	String City;
	String ZIPCode;
	String State;
	String Country;
}

// -----------------------  Setting Properties Values ---------------------

def projectPath = context.expand( '${projectDir}')
	def projpro = new Properties()
	def projectpathnew
	def propertyloc
	projectpathnew = projectPath.replace("\\", "/")
	propertyloc  = projectpathnew.concat("/sharedproject.properties")
	new File(propertyloc).withInputStream { stem ->
  	projpro.load(stem) 
	}
	projpro.each {
    	testRunner.testCase.testSuite.project.setPropertyValue(it.key, it.value)
	}
//-------------------------------------------------Properties Value Set----------

log.info("Calling Track Shipment API")

def inputs = testRunner.testCase.getPropertyValue("InputObject")
def inputMap = new JsonSlurper().parseText(inputs)
def input = new TrackShipmentInPuts(inputMap)

testRunner.testCase.setPropertyValue("Executed", "0")
def pic = input.PIC_NUMBER;
log.info(pic)
if(pic != "")
{
	testRunner.testCase.setPropertyValue("Executed", "1")
	//We need to assign these to test case level properties as we are using these in TrackShipment Test Request
	testRunner.testCase.setPropertyValue("User_ID", input.User_Id )
     testRunner.testCase.setPropertyValue("Pass_Word", input.Pass_Word)
     testRunner.testCase.setPropertyValue("PIC_NUMBER", input.PIC_NUMBER)
     testRunner.testCase.setPropertyValue("City", input.city)
     testRunner.testCase.setPropertyValue("ZIPCode", input.ZIPCode)
     testRunner.testCase.setPropertyValue("State", input.state)
     testRunner.testCase.setPropertyValue("Country", input.country)
}
else
{
	testRunner.gotoStep(testRunner.testCase.getTestStepIndexByName("Result"))
}

def isExecuted = testRunner.testCase.getPropertyValue("Executed") if(isExecuted == "0") log.info("Track Shipment API did not execute") else {
// Logging Request & Response for CreateTrackingEventsFile def response_CreateTrackingEventsFile = context.expand( '${CreateTrackingEventsFile#Response#declare namespace ns1=\'http://qatools/2017/05/ProviderServicesAPIV1\'; //ns1:CreateTrackingEventsFileResponse[1]}' ) log.info("From response: TrackingEventFile: " + response_CreateTrackingEventsFile) def request_eventfile = testRunner.testCase.getTestStepByName("CreateTrackingEventsFile").testRequest.response.requestContent log.info(request_eventfile) def response_eventfile = testRunner.testCase.getTestStepByName("CreateTrackingEventsFile").testRequest.response.responseContent log.info(response_eventfile) log.info("Event Files Created successfully") testRunner.testCase.setPropertyValue("CreateEventFileRequest", request_eventfile) testRunner.testCase.setPropertyValue("CreateEventFileResponse", response_eventfile)
// Logging Request & Response for TrackingEventService def response_TrackingEventService = context.expand( '${TrackingEventService#Response#declare namespace ns1=\'http://qatools/2017/05/ProviderServicesAPIV1\'; //ns1:StartTrackingEventServiceResponse[1]}' ) log.info("From response: TrackingEventService: " + response_TrackingEventService) def request_eventservice = testRunner.testCase.getTestStepByName("TrackingEventService").testRequest.response.requestContent log.info(request_eventservice) def response_eventservice = testRunner.testCase.getTestStepByName("TrackingEventService").testRequest.response.responseContent log.info(response_eventservice) log.info("Event Services Created successfully") testRunner.testCase.setPropertyValue("CreateEventServiceRequest", request_eventservice) testRunner.testCase.setPropertyValue("CreateEventServiceResponse", response_eventservice)
// Logging Request & Response for TrackShipment def response_Carrier = context.expand( '${Trackshipment#Response#declare namespace ns1=\'http://stamps.com/xml/namespace/2018/03/swsim/swsimv71\'; //ns1:TrackShipmentResponse[1]/ns1:Carrier[1]}' ) log.info("From response: Carrier: " + response_Carrier) def ts = testRunner.testCase.getTestStepByName("Trackshipment").testRequest.response.responseContent log.info(ts) def ts1 = testRunner.testCase.getTestStepByName("Trackshipment").testRequest.response.requestContent log.info(ts1) log.info("Track Shipment API executed successfully") testRunner.testCase.setPropertyValue("TSRequestContent", ts1) testRunner.testCase.setPropertyValue("TSResponseContent", ts)
}
